import React from 'react';
import {BrowserRouter, Route, Switch, Redirect} from 'react-router-dom';
import MainPage from './MainPage';
import CategoryPage from './CategoryPage';

class Router extends React.Component{


    render(){
        return(
    
    <BrowserRouter>
            <Switch>
            <Route path="/" component ={MainPage} exact></Route>
            <Route 
            path= '/Section/US'
            component={CategoryPage}
            // render={ (props) => <CategoryPage 
            //     subreddit = 'USNEWS'
            //     />}
            exact ></Route>
                        <Route 
            path= '/Section/World'
            onChange={console.log("WORLD")}
            render={ (props) => <CategoryPage 
                subreddit = 'worldnews'
                />}
            exact ></Route>
            <Route 
            path= '/Section/Politics'
            render={ (props) => <CategoryPage 
                subreddit = 'politics'
                />}
            exact ></Route>
                        <Route 
            path= '/Section/Business'
            render={ (props) => <CategoryPage 
                subreddit = 'business'
                />}
            exact ></Route>
                        <Route 
            path= '/Section/Technology'
            render={ (props) => <CategoryPage 
                subreddit = 'technews'
                />}
            exact ></Route>
                        <Route 
            path= '/Section/Sports'
            render={ (props) => <CategoryPage 
                subreddit = 'sports'
                />}
            ></Route>
                        <Route 
            path= '/Section/Gaming'
            render={ (props) => <CategoryPage 
                subreddit = 'gamernews'
                />}
            exact ></Route>
                        <Route 
            path= '/Section/Feedback'
            render={ (props) => <CategoryPage 
                subreddit = {undefined}
                />}
            exact ></Route>
            <Redirect to='/Section/US' />
            </Switch>

    
    </BrowserRouter>
        );
    }
}

export default Router;
